// Day 10 - Directional Board 
// origibal code by Vince Osadchuck 
// this version was written by Peter Kowald - South Australia (this version is roughly the way I would do it)
// Note this is still void of a debounce because its not really needed  

////////////// DEBUG /////////////
#define ENABLE_DEBUG 0 // set this to 1 to enable debug


// define the led outout pins 
#define opin_led_1 2 // the number of the LED pin 
#define opin_led_2 3 
#define opin_led_3 4 
#define opin_led_4 5 
#define opin_led_5 6 
#define opin_led_6 7 
#define opin_led_7 8

// inputs: 
#define ipin_switch_1 A1 // Switches to choose the pattern 
#define ipin_switch_2 A3 
#define ipin_switch_3 A5 
bool switch_state_1 = 0; 
bool switch_state_2 = 0; 
bool switch_state_3 = 0;

enum // and enum is list of constant names witht eh first calue starting at 0
{
   SEQUENCE_OFF,
   SEQUENCE_LEFT_GROW,
   SEQUENCE_MIDDLE_SPREAD,
   SEQUENCE_LEFT_TRACER,
   SEQUENCE_RIGHT_GROW,
   SEQUENCE_FLASH_SPLIT,
   SEQUENCE_RIGHT_TRACER,
   SEQUENCE_FLASH_ALL,
};

struct
{
    uint32_t delay; // this controls how long until the next sequence step 
    uint32_t last_millis = 0UL; // this will record the current millis time when it expires 
    uint8_t  mode = SEQUENCE_OFF; // this is what type of sequence is running
    uint8_t  step; // this is the stage of the sequence
} sequence;


void setup() 
{
  // set the digital pin as output:
  pinMode(opin_led_1, OUTPUT);
  pinMode(opin_led_2, OUTPUT);
  pinMode(opin_led_3, OUTPUT);
  pinMode(opin_led_4, OUTPUT);
  pinMode(opin_led_5, OUTPUT);
  pinMode(opin_led_6, OUTPUT);
  pinMode(opin_led_7, OUTPUT);

  // set the digital pin as inputs with exteranl pull down resistors
  pinMode(ipin_switch_1, INPUT);
  pinMode(ipin_switch_2, INPUT);
  pinMode(ipin_switch_3, INPUT);


  // perform a LED test, start the serial port and read the initial state of hte switched
  set_all_LEDs(true); // not true and HIGH are the same thing
      // while we are waiting start the serial terminal port and wait for it to engauge
      #if ENABLE_DEBUG == 1
        Serial.begin(9600); while(!Serial);
        Serial.println("Directional Board - LED Self Test"); // opening message note F("") is a way of storing the message in Flash memory
      #endif
      
      // read in the inital switch states but set them to the opposite values to forece a change event in the loop
      switch_state_1 = !digitalRead(ipin_switch_1);
      switch_state_2 = !digitalRead(ipin_switch_2);
      switch_state_3 = !digitalRead(ipin_switch_3);
  
      delay(500UL); // not harm in a delay in the setup
  set_all_LEDs(false); // not false and LOW are the same thing
  
}

void loop() 
{

  if(pole_input_switches()) // pole the switches, return true if any switch has changed, the state of each switch in held in the global switch_state_x
  {
      determine_sequence_number();
  }

  sequencer(); // run what ever sequence mode is on
}


///////////////////////////////////////////////////////////////////////////////////////////
// This function will pole the input switches for theere state.
// The state of each switch will be held in a global variables: switch_state_x
// The function returs true if the state of any switch has changed
///////////////////////////////////////////////////////////////////////////////////////////
bool pole_input_switches() 
{
  //Read the digital switch state and see if any have changed (ignoring contact bouncing)
  bool switch_changed = false; // this will tell us if any switches have changed
  if(digitalRead(ipin_switch_1) != switch_state_1)
  {
     switch_changed = true; // flag a switch has changed state
     switch_state_1 ^= true; // follow the switch state - this (^= true;) will flip the state of the switchxValue, if its true it will become false and if false it will become true
    #if ENABLE_DEBUG == 1
       Serial.print(F("Switch1 changed to: "));
       Serial.println(switch_state_1);
    #endif   
  }
  if(digitalRead(ipin_switch_2) != switch_state_2)
  {
     switch_changed = true; // flag a switch has changed state
     switch_state_2 ^= true; // follow the switch state - this (^= true;) will flip the state of the switchxValue, if its true it will become false and if false it will become true
     #if ENABLE_DEBUG == 1
        Serial.print(F("Switch2 changed to: "));
        Serial.println(switch_state_2);
     #endif
  }
  if(digitalRead(ipin_switch_3) != switch_state_3)
  {
     switch_changed = true; // flag a switch has changed state
     switch_state_3 ^= true; // follow the switch state - this (^= true;) will flip the state of the switchxValue, if its true it will become false and if false it will become true
     #if ENABLE_DEBUG == 1
        Serial.print(F("Switch3 changed to: "));
        Serial.println(switch_state_3);
     #endif
  }
   return  switch_changed;
}

///////////////////////////////////////////////////////////////////////////////////////////
// This routine is called if any switch has changed state.
// it will use the switch configuration to create a binary value is the switch settings in a single varible called: sequence_mode
// This routine will also reset the current sequence and prepair for the new one
///////////////////////////////////////////////////////////////////////////////////////////
inline void determine_sequence_number()
{
    set_all_LEDs(false); // turn off all leds
    
    // this is a little complex but what am going to do is effeciently conver three switch states into a single number 0 to 7
    sequence.mode = 0; // clear the variable
    sequence.mode |= switch_state_1? 1: 0; // ? ternary operator - this is a type of if statement that is inline  
    sequence.mode |= switch_state_2? 2: 0;  
    sequence.mode |= switch_state_3? 4: 0;  
    #if ENABLE_DEBUG == 1
       Serial.print(F("Sequence Mode = ")) ;
       Serial.println(sequence.mode);
    #endif
    sequence.delay = 0UL; // do not wait
    sequence.last_millis = millis();
    sequence.step = 0; // reset the dequence step
}

///////////////////////////////////////////////////////////////////////////////////////////
// This routine is the main core of the sequence operation
// It will run what ever sequence is selected in the global variable: sequence.mode 
// If no sequence is selected the LED's will remain off
///////////////////////////////////////////////////////////////////////////////////////////
inline void sequencer()
{
  // ok now lets run the sequence
  if(sequence.mode) // any thing but SEQUENCE_OFF or 0
  {
     if(millis() - sequence.last_millis > sequence.delay) // only do this when the time is up
     {
         sequence.last_millis = millis(); // record the current millis 
         switch(sequence.mode)
         {
             case SEQUENCE_LEFT_GROW:
                run_sequence_left_grow();
                break; 

             case SEQUENCE_LEFT_TRACER:   
                run_sequence_left_tracer();
                break; 

             case SEQUENCE_RIGHT_GROW:
                run_sequence_right_grow();
                break; 

             case SEQUENCE_RIGHT_TRACER:
                run_sequence_right_tracer();
                break;

             case SEQUENCE_MIDDLE_SPREAD:
                run_sequence_middle_spread();
                break; 
             
             case SEQUENCE_FLASH_SPLIT:
                run_sequence_flash_split();
                break; 
             
             case SEQUENCE_FLASH_ALL:   
                run_sequence_flash_all();
                break; 
         }
     }
  }
}

void set_all_LEDs(bool state)
{
  digitalWrite(opin_led_1, state);
  digitalWrite(opin_led_2, state);
  digitalWrite(opin_led_3, state);
  digitalWrite(opin_led_4, state);
  digitalWrite(opin_led_5, state);
  digitalWrite(opin_led_6, state);
  digitalWrite(opin_led_7, state);
}

// Left Hand Solid Sequence when switch 1 only is activated.
void run_sequence_left_grow()
{
   sequence.delay = 100UL; // in most cases the delay will be 100 ms
   switch(++sequence.step) // test and increment seqience step
   {
      case 1:
        digitalWrite(opin_led_1, HIGH);
        break;
      case 2:
        digitalWrite(opin_led_2, HIGH);
        break;
      case 3:
        digitalWrite(opin_led_3, HIGH);
        break;
      case 4:
        digitalWrite(opin_led_4, HIGH);
        break;
      case 5:
        digitalWrite(opin_led_5, HIGH);
        break;
      case 6:
        digitalWrite(opin_led_6, HIGH);
        break;

      case 7: // last LED - so now we will leave all on for a longer time
        digitalWrite(opin_led_7, HIGH);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        break;

      case 8: // all leds off
        set_all_LEDs(false);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        sequence.step = 0; // repeat the sequence
        break;
   }
}


//Center Solid Sequence When Switch 2 only is activated.
void run_sequence_middle_spread()
{
   sequence.delay = 200UL; // in most cases the delay will be 100 ms
   switch(++sequence.step) // test and increment seqience step
   {
      case 1:
        digitalWrite(opin_led_4, HIGH);
        break;
      case 2:
        digitalWrite(opin_led_3, HIGH);
        digitalWrite(opin_led_5, HIGH);
        break;
      case 3:
        digitalWrite(opin_led_2, HIGH);
        digitalWrite(opin_led_6, HIGH);
        break;
        
      case 4:
        digitalWrite(opin_led_1, HIGH);
        digitalWrite(opin_led_7, HIGH);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        break;

      case 5: // all leds off
        set_all_LEDs(false);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        sequence.step = 0; // repeat the sequence
        break;
   }
}

//Right Hand Sequence when swithc 3 is pressed.
void run_sequence_right_grow()
{
   sequence.delay = 100UL; // in most cases the delay will be 100 ms
   switch(++sequence.step) // test and increment seqience step
   {
      case 1:
        digitalWrite(opin_led_7, HIGH);
        break;
      case 2:
        digitalWrite(opin_led_6, HIGH);
        break;
      case 3:
        digitalWrite(opin_led_5, HIGH);
        break;
      case 4:
        digitalWrite(opin_led_4, HIGH);
        break;
      case 5:
        digitalWrite(opin_led_3, HIGH);
        break;
      case 6:
        digitalWrite(opin_led_2, HIGH);
        break;

      case 7: // last LED - so now we will leave all on for a longer time
        digitalWrite(opin_led_1, HIGH);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        break;

      case 8: // all leds off
        set_all_LEDs(false);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        sequence.step = 0; // repeat the sequence
        break;
   }
}

//Left Hand follower Sequence when switch 1 and 2 are activated.
void run_sequence_left_tracer()
{
   sequence.delay = 100UL; // in most cases the delay will be 100 ms
   switch(++sequence.step) // test and increment seqience step
   {
      case 1:
        digitalWrite(opin_led_1, HIGH);
        break;
      case 2:
        digitalWrite(opin_led_1, LOW);
        digitalWrite(opin_led_2, HIGH);
        break;
      case 3:
        digitalWrite(opin_led_2, LOW);
        digitalWrite(opin_led_3, HIGH);
        break;
      case 4:
        digitalWrite(opin_led_3, LOW);
        digitalWrite(opin_led_4, HIGH);
        break;
      case 5:
        digitalWrite(opin_led_4, LOW);
        digitalWrite(opin_led_5, HIGH);
        break;
      case 6:
        digitalWrite(opin_led_5, LOW);
        digitalWrite(opin_led_6, HIGH);
        break;

      case 7: // last LED - so now we will leave all on for a longer time
        digitalWrite(opin_led_6, LOW);
        digitalWrite(opin_led_7, HIGH);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        break;

      case 8: // all leds off
        set_all_LEDs(false);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        sequence.step = 0; // repeat the sequence
        break;
   }
}

//Right Hand follower Sequence when switch 2 and 3 are activated.
void run_sequence_right_tracer()
{
   sequence.delay = 100UL; // in most cases the delay will be 100 ms
   switch(++sequence.step) // test and increment seqience step
   {
      case 1:
        digitalWrite(opin_led_7, HIGH);
        break;
      case 2:
        digitalWrite(opin_led_7, LOW);
        digitalWrite(opin_led_6, HIGH);
        break;
      case 3:
        digitalWrite(opin_led_6, LOW);
        digitalWrite(opin_led_5, HIGH);
        break;
      case 4:
        digitalWrite(opin_led_5, LOW);
        digitalWrite(opin_led_4, HIGH);
        break;
      case 5:
        digitalWrite(opin_led_4, LOW);
        digitalWrite(opin_led_3, HIGH);
        break;
      case 6:
        digitalWrite(opin_led_3, LOW);
        digitalWrite(opin_led_2, HIGH);
        break;

      case 7: // last LED - so now we will leave all on for a longer time
        digitalWrite(opin_led_2, LOW);
        digitalWrite(opin_led_1, HIGH);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        break;

      case 8: // all leds off
        set_all_LEDs(false);
        sequence.delay = 500UL; // in most cases the delay will be 100 ms
        sequence.step = 0; // repeat the sequence
        break;
   }
}


//Sequence when Switch 1 and 3 are on, switch 2 is off.
void run_sequence_flash_split()
{
   sequence.delay = 250UL; // in most cases the delay will be 100 ms
   sequence.step ^= true; // we are just going to keep flipping the sequence step btween 0 and 1
   set_all_LEDs(false);
   if(sequence.step)
   {
      digitalWrite(opin_led_2,HIGH);
      digitalWrite(opin_led_4,HIGH);
      digitalWrite(opin_led_6,HIGH);
   }
   else // flip
   {
      digitalWrite(opin_led_1,HIGH);
      digitalWrite(opin_led_3,HIGH);
      digitalWrite(opin_led_5,HIGH);
      digitalWrite(opin_led_7,HIGH);
   }
}

void run_sequence_flash_all()
{
   sequence.delay = 250UL; // in most cases the delay will be 100 ms
   sequence.step ^= true; // we are just going to keep flipping the sequence step btween 0 and 1
   set_all_LEDs(sequence.step); // we are going to use the  sequence_step as a bollean equivilant to toggle the led states 
}

/**
* Problem statement: https://leetcode.com/problems/reverse-bits/
*/

/**
 * @param {number} n - a positive integer
 * @return {number} - a positive integer
 */
var reverseBits = function(n) {
    result = 0
    count = 32
    while(count--) {
        // step up the binary decimal for each time we lengthen it (e.g. 0001 becomes 0010)
        result *= 2
        // add the latest binary digit to the result (e.g. 0001001 & 1 yields 1, 0001000 & 1 yields 0)
        result += n & 1
        // remove the right-most digit from the un-reversed number
        n = n >> 1
    }
    return result
};

