// Day 10 - Directional Board 
// origibal code by Vince Osadchuck 
// this version was written by Peter Kowald - South Australia (caveat: this is not how I would write for my own project - this is for learning about ways to use millis and basic sequencing)

// constants won't change. Used here to set a pin number: all pins are bytes 
const byte led1 = 2; // the number of the LED pin 
const byte led2 = 3; 
const byte led3 = 4; 
const byte led4 = 5; 
const byte led5 = 6; 
const byte led6 = 7; 
const byte led7 = 8;

// Variables will change: 
const byte Switch1 = A1; // Switches to choose the pattern 
const byte Switch2 = A3; 
const byte Switch3 = A5; 
bool switch1Value = 0; 
bool switch2Value = 0; 
bool switch3Value = 0;

enum // and enum is list of constant names witht eh first calue starting at 0
{
   SEQUENCE_OFF,
   SEQUENCE_LEFT_GROW,
   SEQUENCE_MIDDLE_SPREAD,
   SEQUENCE_LEFT_TRACER,
   SEQUENCE_RIGHT_GROW,
   SEQUENCE_FLASH_SPLIT,
   SEQUENCE_RIGHT_TRACER,
   SEQUENCE_FLASH_ALL,
};

unsigned int  sequence_mode = SEQUENCE_OFF; // this is what type of sequence is running
byte          sequence_step; // this is the stage of the sequence
unsigned long sequence_delay; 
unsigned long sequence_last_millis = 0UL; // this will record the current millis time when it expires 


void setup() 
{
  // start the virtual pin reader
   
  // set the digital pin as output:
  pinMode(led1, OUTPUT);
  pinMode(led2, OUTPUT);
  pinMode(led3, OUTPUT);
  pinMode(led4, OUTPUT);
  pinMode(led5, OUTPUT);
  pinMode(led6, OUTPUT);
  pinMode(led7, OUTPUT);

  // set the digital pin as inputs with exteranl pull down resistors
  pinMode(Switch1, INPUT);
  pinMode(Switch2, INPUT);
  pinMode(Switch3, INPUT);


  // perform a LED test, start the serial port and read the initial state of hte switched
  set_all_LEDs(true); // not true and HIGH are the same thing
    // while we are waiting start the serial terminal port and wait for it to engauge
    Serial.begin(9600); while(!Serial);
    Serial.println("Directional Board - LED Self Test"); // opening message note F("") is a way of storing the message in Flash memory

    // read in the inital switch states but set them to the opposite values to forece a change event in the loop
    switch1Value = !digitalRead(Switch1);
    switch2Value = !digitalRead(Switch2);
    switch3Value = !digitalRead(Switch3);

    delay(500UL); // not harm in a delay in the setup
  set_all_LEDs(false); // not false and LOW are the same thing
  
}

void loop() 
{
  //Read the digital switch state and see if any have changed (ignoring contact bouncing)
  static bool switch_changed = false; // this will tell us if any switches have changed
  if(digitalRead(Switch1) != switch1Value)
  {
     switch_changed = true; // flag a switch has changed state
     switch1Value ^= true; // follow the switch state - this (^= true;) will flip the state of the switchxValue, if its true it will become false and if false it will become true
     Serial.print(F("Switch1 changed to: "));
     Serial.println(switch1Value);
  }
  if(digitalRead(Switch2) != switch2Value)
  {
     switch_changed = true; // flag a switch has changed state
     switch2Value ^= true; // follow the switch state - this (^= true;) will flip the state of the switchxValue, if its true it will become false and if false it will become true
     Serial.print(F("Switch2 changed to: "));
     Serial.println(switch2Value);
  }
  if(digitalRead(Switch3) != switch3Value)
  {
     switch_changed = true; // flag a switch has changed state
     switch3Value ^= true; // follow the switch state - this (^= true;) will flip the state of the switchxValue, if its true it will become false and if false it will become true
     Serial.print(F("Switch3 changed to: "));
     Serial.println(switch3Value);
  }

  if(switch_changed) // ok folk a switched has changed so we need to look at what sequence to run
  {
      switch_changed = false;
      set_all_LEDs(false); // turn off all leds
      
      // this is a little complex but what am going to do is effeciently conver three switch states into a single number 0 to 7
      sequence_mode = 0; // clear the variable
      sequence_mode |= switch1Value? 1: 0; // ? ternary operator - this is a type of if statement that is inline  
      sequence_mode |= switch2Value? 2: 0;  
      sequence_mode |= switch3Value? 4: 0;  
      Serial.print(F("Sequence Mode = ")) ;
      Serial.println(sequence_mode);
      sequence_delay = 0UL; // do not wait
      sequence_last_millis = millis();
      sequence_step = 0; // reset the dequence step
  }

  // ok now lets run the sequence
  if(sequence_mode) // any thing but SEQUENCE_OFF or 0
  {
     if(millis() - sequence_last_millis > sequence_delay) // only do this when the time is up
     {
         sequence_last_millis = millis(); // record the current millis 
         switch(sequence_mode)
         {
             case SEQUENCE_LEFT_GROW:
                run_sequence_left_grow();
                break; 

             case SEQUENCE_LEFT_TRACER:   
                run_sequence_left_tracer();
                break; 

             case SEQUENCE_RIGHT_GROW:
                run_sequence_right_grow();
                break; 

             case SEQUENCE_RIGHT_TRACER:
                run_sequence_right_tracer();
                break;

             case SEQUENCE_MIDDLE_SPREAD:
                run_sequence_middle_spread();
                break; 
             
             case SEQUENCE_FLASH_SPLIT:
                run_sequence_flash_split();
                break; 
             
             case SEQUENCE_FLASH_ALL:   
                run_sequence_flash_all();
                break; 
         }
     }
  }
}

void set_all_LEDs(bool state)
{
  digitalWrite(led1, state);
  digitalWrite(led2, state);
  digitalWrite(led3, state);
  digitalWrite(led4, state);
  digitalWrite(led5, state);
  digitalWrite(led6, state);
  digitalWrite(led7, state);
}

// Left Hand Solid Sequence when switch 1 only is activated.
void run_sequence_left_grow()
{
   sequence_delay = 100UL; // in most cases the delay will be 100 ms
   switch(++sequence_step) // test and increment seqience step
   {
      case 1:
        digitalWrite(led1, HIGH);
        break;
      case 2:
        digitalWrite(led2, HIGH);
        break;
      case 3:
        digitalWrite(led3, HIGH);
        break;
      case 4:
        digitalWrite(led4, HIGH);
        break;
      case 5:
        digitalWrite(led5, HIGH);
        break;
      case 6:
        digitalWrite(led6, HIGH);
        break;

      case 7: // last LED - so now we will leave all on for a longer time
        digitalWrite(led7, HIGH);
        sequence_delay = 500UL; // in most cases the delay will be 100 ms
        break;

      case 8: // all leds off
        set_all_LEDs(false);
        sequence_delay = 500UL; // in most cases the delay will be 100 ms
        sequence_step = 0; // repeat the sequence
        break;
   }
}


