//Left Hand follower Sequence when switch 1 and 2 are activated.
void run_sequence_left_tracer()
{
   sequence_delay = 100UL; // in most cases the delay will be 100 ms
   switch(++sequence_step) // test and increment seqience step
   {
      case 1:
        digitalWrite(led1, HIGH);
        break;
      case 2:
        digitalWrite(led1, LOW);
        digitalWrite(led2, HIGH);
        break;
      case 3:
        digitalWrite(led2, LOW);
