        break;
      case 2:
        digitalWrite(led7, LOW);
        digitalWrite(led6, HIGH);
        break;
      case 3:
        digitalWrite(led6, LOW);
        digitalWrite(led5, HIGH);
        break;
      case 4:
        digitalWrite(led5, LOW);
        digitalWrite(led4, HIGH);
        break;
      case 5:
        digitalWrite(led4, LOW);
        digitalWrite(led3, HIGH);
        break;
      case 6:
        digitalWrite(led3, LOW);
        digitalWrite(led2, HIGH);
        break;

      case 7: // last LED - so now we will leave all on for a longer time
        digitalWrite(led2, LOW);
        digitalWrite(led1, HIGH);
        sequence_delay = 500UL; // in most cases the delay will be 100 ms
        break;

      case 8: // all leds off
        set_all_LEDs(false);
        sequence_delay = 500UL; // in most cases the delay will be 100 ms
        sequence_step = 0; // repeat the sequence
        break;
   }
}


//Sequence when Switch 1 and 3 are on, switch 2 is off.
void run_sequence_flash_split()
{
   sequence_delay = 250UL; // in most cases the delay will be 100 ms
   sequence_step ^= true; // we are just going to keep flipping the sequence step btween 0 and 1
   set_all_LEDs(false);
   if(sequence_step)
   {
      digitalWrite(led2,HIGH);
      digitalWrite(led4,HIGH);
      digitalWrite(led6,HIGH);
   }
   else // flip
   {
      digitalWrite(led1,HIGH);
      digitalWrite(led3,HIGH);
      digitalWrite(led5,HIGH);
      digitalWrite(led7,HIGH);
   }
}

void run_sequence_flash_all()
{
   sequence_delay = 250UL; // in most cases the delay will be 100 ms
   sequence_step ^= true; // we are just going to keep flipping the sequence step btween 0 and 1
   set_all_LEDs(sequence_step); // we are going to use the  sequence_step as a bollean equivilant to toggle the led states 
}

