        sequence_delay = 500UL; // in most cases the delay will be 100 ms
        sequence_step = 0; // repeat the sequence
        break;
   }
}


//Sequence when Switch 1 and 3 are on, switch 2 is off.
void run_sequence_flash_split()
{
   sequence_delay = 250UL; // in most cases the delay will be 100 ms
   sequence_step ^= true; // we are just going to keep flipping the sequence step btween 0 and 1
   set_all_LEDs(false);
   if(sequence_step)
   {
      digitalWrite(led2,HIGH);
      digitalWrite(led4,HIGH);
      digitalWrite(led6,HIGH);
   }
   else // flip
   {
      digitalWrite(led1,HIGH);
      digitalWrite(led3,HIGH);
      digitalWrite(led5,HIGH);
      digitalWrite(led7,HIGH);
   }
}

void run_sequence_flash_all()
{
   sequence_delay = 250UL; // in most cases the delay will be 100 ms
   sequence_step ^= true; // we are just going to keep flipping the sequence step btween 0 and 1
   set_all_LEDs(sequence_step); // we are going to use the  sequence_step as a bollean equivilant to toggle the led states 
}

class ClassA {
    iter = 0;
    name = null;
    constructor() {
        this.iter = 1;
        this.name = 'ClassA';
    }
    loop() {
        this.iter ++;
        console.log(this.iter);
        this.timeId = setTimeout(()=>{this.loop()}, 1000)
    }
}
class ClassB {
    name = null;
    constructor() {
        this.name = 'ClassB';
    }
    unload(stage, name) {
        clearTimeout(stage[name].timeId)
        delete stage[name];
    }
}
const classes = {};
classes.a = new ClassA();
classes.a.loop();

const b = new ClassB();
b.unload(classes, 'a');

console.log(classes, b)

local modem = peripheral.find("modem", rednet.open)

function getModem()
    return modem
end

function send(id, protocol, table)
    local data = textutils.serialize(table)
    rednet.send(id, data, protocol)
end

function receive()
    local id, data, protocol = rednet.receive()
    local table = textutils.unserialize(data)
    
    return id, protocol, table
end

function request(id, protocol, table)
   send(id, protocol, table)
    return receive()
end

return {
	getModem = getModem,
    send = send,
    receive = receive,
    request = request
}

