const char *ssid =  "DELAROSA";     // replace with your wifi ssid and wpa2 key
const char *pass =  "$Dtd50djfA";
const char* server = "api.thingspeak.com";
 
#define DHTPIN D2          //pin where the dht11 is connected
 
