function arrayModifier(input) {
    let numbers = input[0].split(' ').map(Number);

    for (let i = 1; input[i] != "end"; i++) {
        [command, index1, index2] = input[i].split(' ');

        if (command == "decrease") {
            for (let i = 0; i < numbers.length; i++) {
                numbers[i]--;
            }
        } else {
            if (command == "swap") {
                let value = numbers[index1];
                numbers[index1] = numbers[index2];
                numbers[index2] = value;
            } else {
                numbers[index1] *= numbers[index2];
            }
        }
    }
    
    console.log(numbers.join(", "));
    return;
}

// CLASE FAMILIA

public abstract class Familia {
	
	//Atributos
	
	protected int numeroLibroFamilia;
	protected String direccion;
	protected String poblacion;
	protected String provincia;
	
	// Constructor
	
	public Familia() {
		this.numeroLibroFamilia = 254515;
		this.direccion = "C/ Vicente Clavel 4";
		this.poblacion = "Valencia";
		this.provincia = "Valencia";
	}
	
	public Familia(int numeroLibroFamilia, String direccion, String poblacion, String provincia) {
		this.numeroLibroFamilia = numeroLibroFamilia;
		this.direccion = direccion;
		this.poblacion = poblacion;
		this.provincia = provincia;
	}
	
	// Getters and Setters

	public int getNumeroLibroFamilia() {
		return numeroLibroFamilia;
	}

	public void setNumeroLibroFamilia(int numeroLibroFamilia) {
		this.numeroLibroFamilia = numeroLibroFamilia;
	}

	public String getDireccion() {
		return direccion;
	}

	public void setDireccion(String direccion) {
		this.direccion = direccion;
	}

	public String getPoblacion() {
		return poblacion;
	}

	public void setPoblacion(String poblacion) {
		this.poblacion = poblacion;
	}

	public String getProvincia() {
		return provincia;
	}

	public void setProvincia(String provincia) {
		this.provincia = provincia;
	}
	
	// Metodos propios
	public abstract float imc();
}

// CLASE PERSONA
public class Persona extends Familia{
	// Atributos
	protected String nombre;
	protected int edad;
	protected String dNI;
	protected float peso;
	protected float altura;
	
	// Contructor
	public Persona() {
		this.nombre = "Sergio";
		this.edad = 27;
		this.dNI = "21795642z";
		this.peso = 85f;
		this.altura = 1.74f;
	}

	public Persona(String nombre, int edad, String dNI, float peso, float altura) {
		this.nombre = nombre;
		this.edad = edad;
		this.dNI = dNI;
		this.peso = peso;
		this.altura = altura;
	}

	// Getters y setters
	public String getNombre() {
		return nombre;
	}

	public void setNombre(String nombre) {
		this.nombre = nombre;
	}

	public int getEdad() {
		return edad;
	}

	public void setEdad(int edad) {
		this.edad = edad;
	}

	public String getdNI() {
		return dNI;
	}

	public void setdNI(String dNI) {
		this.dNI = dNI;
	}

	public float getPeso() {
		return peso;
	}

	public void setPeso(float peso) {
		this.peso = peso;
	}

	public float getAltura() {
		return altura;
	}

	public void setAltura(float altura) {
		this.altura = altura;
	}
	// Metodos
	@Override
	public float imc() {
		float imc = 0.0f;
		
		imc = this.peso / (this.altura * this.altura);
		
		return imc;
	}
	
	
}

